import React, { useState } from 'react'

function Dummy() {
    let obj ={
        name : "sachin",
        age : "24",
        height : 6,
        color : "black"
    }
   
    let array = []
    function handleClick(){
            array.push(obj)
            for (let index = 0; index < 3; index++) {
              
                array.push(obj)
                alert(JSON.stringify(array))
            }
    }
    return (
        <div>
            <button onClick={handleClick} >Click me</button>
        </div>
    )
}

export default Dummy
